// src/components/Navbar.js
import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Box,
  Button,
  Badge,
  Paper,
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import IcecreamIcon from "@mui/icons-material/Icecream";
import { Link, useNavigate } from "react-router-dom";
import { getCart } from "../api/cart";

export default function Navbar({ currentUser, onLogout }) {
  const [count, setCount] = useState(0);
  const navigate = useNavigate();

  // Fetch cart count
  useEffect(() => {
    if (!currentUser || currentUser.role === "ADMIN") {
      setCount(0);
      return;
    }

    getCart(currentUser.username)
      .then((res) => {
        const items = res.data || [];
        const total = items.reduce((s, it) => s + (it.quantity || 1), 0);
        setCount(total);
      })
      .catch(() => setCount(0));
  }, [currentUser]);

  return (
    <Paper
      elevation={6}
      sx={{
        position: "sticky",
        top: 0,
        zIndex: 2000,
        borderRadius: "0 0 30px 30px",
        background: "rgba(255, 230, 240, 0.75)",
        backdropFilter: "blur(10px)",
        borderBottom: "2px solid #ffc2d8",
      }}
    >
      <AppBar
        elevation={0}
        position="static"
        sx={{
          background: "linear-gradient(90deg, #ffd4e5, #ffe8f1, #ffd7e8)",
          borderRadius: "0 0 30px 30px",
        }}
      >
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "space-between",
            py: 2,
          }}
        >
          {/* LOGO */}
          <Box
            display="flex"
            alignItems="center"
            component={Link}
            to="/"
            sx={{ textDecoration: "none" }}
          >
            <IcecreamIcon sx={{ color: "#ff4f7b", fontSize: 36, mr: 1 }} />
            <Typography
              variant="h4"
              sx={{
                color: "#d6246c",
                fontWeight: "900",
                fontFamily: "'Poppins', sans-serif",
                letterSpacing: 1.5,
              }}
            >
              SweetCraft
            </Typography>
          </Box>

          {/* MIDDLE NAV MENU */}
          <Box>
            {["Home", "Categories"].map((item, i) => (
              <Button
                key={i}
                component={Link}
                to={item === "Home" ? "/" : "/categories"}
                sx={{
                  mx: 1,
                  fontSize: "1.1rem",
                  fontWeight: 700,
                  color: "#a12456",
                  textTransform: "none",
                  "&:hover": {
                    color: "#d6246c",
                    transform: "scale(1.05)",
                  },
                }}
              >
                {item}
              </Button>
            ))}

            {/* User routes */}
            {currentUser?.role !== "ADMIN" && (
              <Button
                component={Link}
                to="/orders"
                sx={{
                  mx: 1,
                  fontSize: "1.1rem",
                  fontWeight: 700,
                  color: "#a12456",
                  textTransform: "none",
                  "&:hover": { color: "#d6246c", transform: "scale(1.05)" },
                }}
              >
                My Orders
              </Button>
            )}

            {/* Admin only */}
            {currentUser?.role === "ADMIN" && (
              <Button
                component={Link}
                to="/admin"
                sx={{
                  mx: 1,
                  fontSize: "1.1rem",
                  fontWeight: 700,
                  color: "#a12456",
                  textTransform: "none",
                  "&:hover": { color: "#d6246c", transform: "scale(1.05)" },
                }}
              >
                Admin
              </Button>
            )}
          </Box>

          {/* RIGHT SIDE */}
          <Box display="flex" alignItems="center">
            {!currentUser ? (
              <>
                <Button
                  onClick={() => navigate("/login")}
                  sx={{
                    color: "#a12456",
                    fontSize: "1rem",
                    textTransform: "none",
                    mx: 1,
                  }}
                >
                  Login
                </Button>

                <Button
                  onClick={() => navigate("/register")}
                  sx={{
                    color: "#a12456",
                    fontSize: "1rem",
                    textTransform: "none",
                    mx: 1,
                  }}
                >
                  Register
                </Button>
              </>
            ) : (
              <>
                <Typography
                  sx={{
                    mr: 2,
                    fontWeight: "bold",
                    fontSize: "1.2rem",
                    color: "#8a2e4d",
                  }}
                >
                  {currentUser.username}
                </Typography>

                <Button
                  onClick={onLogout}
                  sx={{
                    color: "#a12456",
                    textTransform: "none",
                    fontSize: "1rem",
                  }}
                >
                  Logout
                </Button>
              </>
            )}

            {/* CART ICON */}
            {currentUser?.role !== "ADMIN" && (
              <IconButton onClick={() => navigate("/cart")} sx={{ ml: 1 }}>
                <Badge
                  badgeContent={count}
                  sx={{
                    "& .MuiBadge-badge": {
                      backgroundColor: "#ff4f7b",
                      color: "white",
                      fontSize: "0.8rem",
                    },
                  }}
                >
                  <ShoppingCartIcon sx={{ color: "#d6246c", fontSize: 32 }} />
                </Badge>
              </IconButton>
            )}
          </Box>
        </Toolbar>
      </AppBar>
    </Paper>
  );
}
